import Button from "../../Button";

const Learn_Middle = ({
  title = false,
  topic = false,
  describe = false,
  link1 = false,
  link1_label = false,
  link2 = false,
  link2_label = false,
  light = false,
}) => {
  if (title) {
    return (
      <section
        className={`padding flex ${light && "bg-slate-50 text-slate-950"}`}
      >
        <div className="md:w-2/5 w-full md:px-10 flex flex-col">
          <h5>{topic}</h5>
          <h2 className="font-bold sm:text-4xl text-2xl">{title}</h2>
          <p className="md:hidden py-5">{describe}</p>
          <Button to={link1} label={link1_label} outlineDark />
          {link2 && <Button to={link2} label={link2_label} light />}
        </div>
        <p className="w-3/5 px-10 md:block hidden">{describe}</p>
      </section>
    );
  }
};

export default Learn_Middle;
